import React from 'react'
import {Link} from 'react-router-dom'

const About = () => {
    return (
        <div>
            <p><Link to='/'>Inicio</Link></p>
            <p><a href='https://github.com/hramos1999'>Developed by</a></p>
        </div>
    )
}

export default About
